      "value": "Chronically Ill means that within the previous 12 months, you have been certified by a Licensed Health Care Practitioner as: being unable to perform, without Substantial Assistance, at least two Activities of Daily Living for a period of at least 90 days due to loss of functional capacity; or having a severe Cognitive Impairment.",
