      "value": "Cognitive Impairment is your deterioration or loss of intellectual capacity, which requires Substantial Supervision by another person to protect yourself or others from threats to health and safety. It is measured by clinical evidence and standardized tests that reliably measure your impairment in: short or long term memory; your orientation as to person (such as who you are), place (such as your location) and time (such as day, date and year); deductive or abstract reasoning. A Cognitive Impairment includes Alzheimer’s disease and similar forms of irreversible dementia.",
